import './TodoMenu.css'

const TodoMenu = ({editTodo, deleteTodo}) => {

    return (
        <div className="popup">
            <a onClick={editTodo}>Edit</a>
            <a onClick={deleteTodo}>Delete</a>
        </div>
    )
}

export default TodoMenu
